import styles from './ModalButton.module.css'

const ModalButton = ({ children, modalToggle }) => {

  const modalHandler = () => {
    !modalToggle
  }

  return <button className={styles['modal-btn']} onClick={modalHandler}>{children}</button>
}

export default ModalButton
